/* Size */
.btn {
    @apply px-6 py-3 inline-flex space-x-2 items-center justify-between font-bold focus:outline-none;
}
.small-btn {
    @apply px-6 py-1 inline-flex space-x-2 text-title-small items-center font-bold focus:outline-none;
}
.icon-small-btn {
    @apply p-1 flex space-x-2 items-center focus:outline-none;
}
.icon-large-btn {
    @apply p-2 flex space-x-2 items-center focus:outline-none;
}

/* Types */
.primary-btn {
    @apply text-white bg-marsblue-500 hover:bg-marsblue-700;
}
.secondary-btn {
    @apply text-marsblue-500 border border-marsblue-500 hover:bg-marsgray-200;
}
.link-btn {
    @apply text-marsblue-500 bg-transparent hover:bg-marsgray-200;
}
.transparent-btn {
    @apply text-marsgray-700 bg-transparent hover:bg-marsgray-200;
}
.icon-btn {
    @apply text-marsgray-700 bg-transparent hover:bg-marsgray-200;
}

/* Disabled / Enabled */
.disabled-primary-btn {
    @apply text-white bg-gray-400 hover:bg-gray-400 cursor-not-allowed;
}
.disabled-secondary-btn {
    @apply text-gray-400 border border-gray-400 hover:bg-transparent cursor-not-allowed;
}
.disabled-link-btn {
    @apply text-gray-400 cursor-not-allowed bg-transparent hover:bg-transparent;
}
.disabled-transparent-btn {
    @apply text-gray-400 cursor-not-allowed bg-transparent hover:bg-transparent;
}

